import Link from "next/link";


const Registration = () => {
    return (
        <div className="auth-component">
            <form className="auth-form">
                <h1>Sign Up</h1>
                <input type="text" className="common-input" placeholder="Name" />
                <input type="text" className="common-input" placeholder="Password" />
                <button className="common-btn">Register</button>
                <Link href="/authorization">
                    <a className='authorize-link'>or log in</a>
                </Link>
            </form>
            <p className="terms">By registering for this website, you accept our <a href="">Terms of use</a> and out <a href="">Privacy Policy</a></p>
        </div>
    )
}

export default Registration;
